import React, { useEffect, useState } from "react";
import FetchADXData from "../ComponentsFetch/FetchADXData";
import FetchStockDataForCode from "../ComponentsFetch/FetchStockDataForCode";
import FetchStockList from "../ComponentsFetch/FetchStockList";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import HighchartsStock from "highcharts/modules/stock";

HighchartsStock(Highcharts);

function ChartOfADX({ stockCode }) {
    const [stockData, setStockData] = useState([]);
    const [ADXData, setADXData] = useState([]);
    const [options, setOptions] = useState({});

    useEffect(() => {
        if(stockData.length > 0 && stockList.length > 0 && ADXData.length > 0) {
            const formattedADXData = ADXData.map(item => {
                return [
                    new Date(item.date).getTime(),
                    item.ADX
                ];
            });

            const formattedClosePriceData = stockData.map(item => ({
                x: new Date(item.date).getTime(),
                y: item.close
            }));

            const formattedVolumeData = stockData.map(item => ({
                x: new Date(item.date).getTime(),
                y: item.volume,
            }));

            setOptions( {
                chart: {
                    height: 600,
                    spacing: [10, -70, 10, 10],
                    zoomType: 'x',
                    events: {
                        render: function () {
                            this.yAxis[0].axisTitle.attr({
                                x: this.plotLeft +40,
                                y: this.plotTop +20
                            });

                            this.yAxis[1].axisTitle.attr({
                                x: this.plotLeft + 30,
                                y: this.plotTop + (this.plotHeight * 0.55) + 7
                            });

                            this.yAxis[2].axisTitle.attr({
                                x: this.plotLeft + 38,
                                y: this.plotTop + (this.plotHeight * 0.85) -40
                            });
                        }
                    }
                },
                title: {
                    text: '',
                },
                accessibility: {
                  enabled: false
                },
                xAxis: {
                    type: 'datetime',
                    labels: {
                        format: '{value:%m. %d}', // 날짜 형식
                    },
                    crosshair: true,
                },
                yAxis: [
                    {
                        title: {
                            text: 'Close Price',
                            style: {
                                fontSize: '12px',
                            },
                            rotation: 0,
                        },
                        height: '50%',
                        lineWidth:2,
                        opposite: true,
                    },
                    {
                        title: {
                            text: 'Volume',
                            style: {
                                fontSize: '12px',
                            },
                            rotation: 0,
                        },
                        top: '52%',
                        height: '18%',
                        offset: 0,
                        lineWidth: 2,
                        labels: {
                            enabled: false // 볼륨에 라벨 비활성화
                        },
                        opposite: true,
                    },
                    {
                        title: {
                            text: 'ADX',
                            style: {
                                fontSize: '12px'
                            },
                            rotation: 0,
                        },
                        top: '72%',
                        height: '28%',
                        min: 0,
                        max: 50,
                        tickPositions: [0, 10, 20, 30, 40],
                    }
                ],
                series: [
                    {
                        name: 'Close Price',
                            type: 'line',
                            data: formattedClosePriceData, // Close Price 데이터
                            marker: {
                                enabled: false,
                            },
                            yAxis: 0, // 첫 번째 yAxis (Close Price)
                            color: '#0071e3', // Close Price 라인 색상
                            lineWidth: 1.5,
                    },
                    {
                        name: 'Volume',
                        type: 'column',
                        data: formattedVolumeData,
                        yAxis: 1,
                        color: '#A9A9A9', // Volume 컬럼 색상
                        pointWidth: 2,
                    },
                    {
                        name: 'ADX',
                        type: 'line',
                        data: formattedADXData,
                        marker: {
                            enabled: false,
                        },
                        yAxis: 2,
                        color: '#8E44AD',
                        lineWidth: 1.5,
                    }
                ],
                tooltip: {
                    shared: true,
                    crosshairs: true,
                    formatter: function () {
                        let tooltipHtml = `<b>${Highcharts.dateFormat('%m. %d', this.x)}</b><br/>`;
                        this.points.forEach(point => {
                            tooltipHtml += `${point.series.name}: <b>${point.y.toFixed(2)}</b><br/>`;
                        });
                        return tooltipHtml;
                    }
                },
                plotOptions: {
                    series: {
                        states: {
                            inactive: {
                                opacity: 1 // 마우스를 올렸을 때 다른 라인의 투명도를 1로 설정해 희미해지지 않도록 설정
                            },
                            hover: {
                                enabled: true // 마우스 호버 시 희미해지는 기능 비활성화
                            }
                        }
                    }
                },
                rangeSelector: {
                    enabled: true, // 범위 선택 옵션 활성화
                    inputEnabled: false,
                    buttons: [
                        {
                            type: 'month',
                            count: 1,
                            text: '1m'
                        },
                        {
                            type: 'month',
                            count: 3,
                            text: '3m'
                        },
                        {
                            type: 'month',
                            count: 6,
                            text: '6m'
                        },
                        {
                            type: 'ytd',
                            text: 'YTD'
                        },
                        {
                            type: 'year',
                            count: 1,
                            text: '1y'
                        },
                        {
                            type: 'all',
                            text: 'All'
                        }
                    ],
                    selected: 5 // Default 선택 범위 설정 (3개월)
                },
                credits: {
                    enabled: false,
                },
                legend: {
                    enabled: true,
                },
                scrollbar: {
                    enabled: true, // 하단 스크롤바 활성화
                }
            })
        }
    }, [stockData, stockList, ADXData])

    return (
        <div>
            <FetchStockDataForCode stockCode={stockCode} onSDFCFetch={setStockData}/>
            <FetchADXData stockCode={stockCode} onADXFetch={setADXData}/>

            {options.series && options.series.length > 0 && (
                <HighchartsReact highcharts={Highcharts} options={options} />
            )}
        </div>
    )
}

export default ChartOfADX;
